import React from 'react';


const works = [
    {
        name: 'project1',
        path: '',
        thumbnail: 'url(./public/project-images/template-site-bg.png)' //image
    },
    {
        name: 'project2',
        path: '',
        thumbnail: {} //image
    },
    {
        name: 'project3',
        path: '',
        thumbnail: {} //image
    },
    {
        name: 'project4',
        path: '',
        thumbnail: {}  //image
    },
    {
        name: 'project5',
        path: '',
        thumbnail: {}  //image
    }
]

const Projects = () => {

const gridStyle = {

}

const gridItemStyle = {
    
}

return (

    <Container>
        <Grid 
            sx={gridStyle}
        >
            {works.map((work) => (
                <ListItem 
                    key={work}
                    sx={gridItemStyle}
                >
                    <Typography>
                    <Link 
                        href={work.path}
                    >
                        {work.name}
                        {/* text over image? create component? */}
                    </Link>
                    </Typography>
                </ListItem>
                ))}

        </Grid>
    </Container>   
)
}

export default Projects;
